import { ReactDOM } from "react";
import '../App.css';
function DarkModeBtn(){
     
    return (
        <div class="dark-mode">
            <p>Dark Mode</p>
            <label class="switch">
            <input type="checkbox" ></input>
            <span class="slider round"></span>
      </label>
        </div>
    )
}

export default DarkModeBtn ;
